Router.get('/detail', (req, res) => {
  const { name } = req.query;
  CustomerModel.findOne({ name }, (err, customer) => {
    if (!customer) {
      return res.sendStatus(400);
    }
    const { email } = customer;
    res.send({ name, email });
    return true;
  });
});

module.exports = Router;

